Hey,

I have added a error-compressor folder to the lib. There are two files:

-compressor.js : This file is a node.js file, which pulls in uglify-js and basically looks through the AST and modifies it in place to replace

NgError("This {0} is {1}", foo, bar);

with

NgError("NgErr 1 : {0} {1}", foo, bar);

and creates a table with entries

1: This {foo} is {bar}: NgErr 1 : {foo} {bar}

This can later be outputted to a file with proper HTML formatting.

Next steps would be to clean this up and integrate it as part of the compile process, which I will do tomorrow.

As discussed in an email thread, here is a pull request to get dynamic default parameters for $resource so it's possible to do:

var User = $resource('/user', {'group': function() { return $location.search().group; }});

